selector_to_html = {"a[href=\"#upload-your-data-to-a-new-layer-in-ghap\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Upload your data to a new layer in GHAP<a class=\"headerlink\" href=\"#upload-your-data-to-a-new-layer-in-ghap\" title=\"Link to this heading\">#</a></h2><p>Now you have a dataset, you can create a layer in GHAP and upload it.</p><p>You\u2019ll need a GHAP account to proceed. If you don\u2019t have one click on \u2018Login\u2019 and then <a class=\"reference external\" href=\"https://ghap.tlcmap.org/register\">Register</a>. Fill in the required details and wait for the confirmation email to arrive (mine landed in the spam folder).</p>", "a[href=\"#ghap-view-map\"]": "<figure class=\"align-default\" id=\"ghap-view-map\">\n<a class=\"reference internal image-reference\" href=\"../../_images/ghap-view-map.png\"><img alt=\"../../_images/ghap-view-map.png\" src=\"../../_images/ghap-view-map.png\" style=\"width: 400px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 30.20 </span><span class=\"caption-text\">Select \u20183D Viewer\u2019 to display your layer on a map</span><a class=\"headerlink\" href=\"#ghap-view-map\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#ghap-layer-data\"]": "<figure class=\"align-default\" id=\"ghap-layer-data\">\n<a class=\"reference internal image-reference\" href=\"../../_images/ghap-layer-data.png\"><img alt=\"../../_images/ghap-layer-data.png\" src=\"../../_images/ghap-layer-data.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 30.19 </span><span class=\"caption-text\">View the uploaded data on the layer page</span><a class=\"headerlink\" href=\"#ghap-layer-data\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#running-the-notebook\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Running the notebook<a class=\"headerlink\" href=\"#running-the-notebook\" title=\"Link to this heading\">#</a></h3><p>Go to <a class=\"reference external\" href=\"https://glam-workbench.net/trove-maps/create-map-subsets/\">Create a subset of digitised maps by searching for coordinates</a> in the Trove maps section of the GLAM Workbench.</p><p>This notebook, like all GLAM Workbench notebooks, needs to be run in a customised computing environment. The easiest way to do this is through BinderHub. BinderHub is a cloud-based service that gets a notebook up and running by reading its requirements from a code repository, and creating an environment with the necessary software. The GLAM Workbench is integrated with two BinderHub services:</p>", "a[href=\"#ghap-layer-point-info\"]": "<figure class=\"align-default\" id=\"ghap-layer-point-info\">\n<a class=\"reference internal image-reference\" href=\"../../_images/ghap-layer-point-info.png\"><img alt=\"../../_images/ghap-layer-point-info.png\" src=\"../../_images/ghap-layer-point-info.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 30.22 </span><span class=\"caption-text\">Click on the markers to display map details</span><a class=\"headerlink\" href=\"#ghap-layer-point-info\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#create-a-layer-in-the-gazetteer-of-historical-australian-placenames-using-metadata-from-troves-digitised-maps\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Create a layer in the Gazetteer of Historical Australian Placenames using metadata from Trove\u2019s digitised maps<a class=\"headerlink\" href=\"#create-a-layer-in-the-gazetteer-of-historical-australian-placenames-using-metadata-from-troves-digitised-maps\" title=\"Link to this heading\">#</a></h1><p>Trove includes thousands of digitised maps, created and published across the last few centuries. You want to create a collection of maps relating to your area of interest and explore it using the Gazetteer of Historical Australian Placenames (GHAP). You know it\u2019s possible to add layers to GHAP, but how do you get the data from Trove in a format that can be uploaded as a layer?</p>", "a[href=\"#ghap-layer-upload\"]": "<figure class=\"align-default\" id=\"ghap-layer-upload\">\n<a class=\"reference internal image-reference\" href=\"../../_images/ghap-layer-upload.png\"><img alt=\"../../_images/ghap-layer-upload.png\" src=\"../../_images/ghap-layer-upload.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 30.18 </span><span class=\"caption-text\">Select and upload the CSV data file</span><a class=\"headerlink\" href=\"#ghap-layer-upload\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#ghap-home\"]": "<figure class=\"align-default\" id=\"ghap-home\">\n<a class=\"reference internal image-reference\" href=\"../../_images/ghap-home.png\"><img alt=\"../../_images/ghap-home.png\" src=\"../../_images/ghap-home.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 30.14 </span><span class=\"caption-text\">Click on the \u2018My Layers\u2019 link</span><a class=\"headerlink\" href=\"#ghap-home\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#ghap-nb-run\"]": "<figure class=\"align-default\" id=\"ghap-nb-run\">\n<a class=\"reference internal image-reference\" href=\"../../_images/ghap-nb-run.png\"><img alt=\"../../_images/ghap-nb-run.png\" src=\"../../_images/ghap-nb-run.png\" style=\"width: 400px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 30.8 </span><span class=\"caption-text\">Select Run &gt; Run All Cells from the menu</span><a class=\"headerlink\" href=\"#ghap-nb-run\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#understanding-your-results\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Understanding your results<a class=\"headerlink\" href=\"#understanding-your-results\" title=\"Link to this heading\">#</a></h3><p>Both the CSV and GeoJSON files are named according to the coordinates of the bounding box used in the query. So the file named:</p><p><code class=\"docutils literal notranslate\"><span class=\"pre\">174-43359_182-167965_-21-543023_-15-546844.csv</span></code></p>", "a[href=\"#mybinder-tab\"]": "<figure class=\"align-default\" id=\"mybinder-tab\">\n<a class=\"reference internal image-reference\" href=\"../../_images/mybinder-tab.png\"><img alt=\"../../_images/mybinder-tab.png\" src=\"../../_images/mybinder-tab.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 30.6 </span><span class=\"caption-text\">Click on the MyBinder tab</span><a class=\"headerlink\" href=\"#mybinder-tab\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#using-the-notebook-in-jupyter-lab\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Using the notebook in Jupyter Lab<a class=\"headerlink\" href=\"#using-the-notebook-in-jupyter-lab\" title=\"Link to this heading\">#</a></h3><p>No matter what service you use to run the notebook, the result will be the same \u2013 the notebook will open in the Jupyter Lab interface.</p>", "a[href=\"#digitised-map-metadata-and-coordinates\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Digitised map metadata and coordinates<a class=\"headerlink\" href=\"#digitised-map-metadata-and-coordinates\" title=\"Link to this heading\">#</a></h2><p>This tutorial uses two related datasets. The <a class=\"reference external\" href=\"https://glam-workbench.net/trove-maps/single-maps-data/\">first dataset</a> contains data describing digitised maps, <a class=\"reference external\" href=\"https://glam-workbench.net/trove-maps/exploring-digitised-maps/\">harvested</a> from the Trove API and enriched with metadata embedded in the digitised map viewer. This enriched metadata sometimes includes a text string containing spatial information \u2013 either the maps centre point, or a bounding box.</p><p>The search parameters used to create this dataset were:</p>", "a[href=\"#using-ardc-binder\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Using ARDC Binder<a class=\"headerlink\" href=\"#using-ardc-binder\" title=\"Link to this heading\">#</a></h4><p>To use the ARDC Binder service, click on the ARDC Binder tab under the notebook preview. You should see a big, blue <strong>Run live on ARDC Binder</strong> button. Click on the button to launch the Binder service.</p><p>If this is the first time you\u2019ve used the ARDC Binder service you\u2019ll be asked to login using the Australian Access Federation (AAF).</p>", "a[href=\"#ghap-layer-map-info\"]": "<figure class=\"align-default\" id=\"ghap-layer-map-info\">\n<a class=\"reference internal image-reference\" href=\"../../_images/ghap-layer-map-info.png\"><img alt=\"../../_images/ghap-layer-map-info.png\" src=\"../../_images/ghap-layer-map-info.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 30.21 </span><span class=\"caption-text\">Explore your layer on a 3D map</span><a class=\"headerlink\" href=\"#ghap-layer-map-info\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#ghap-nb-geojson-open\"]": "<figure class=\"align-default\" id=\"ghap-nb-geojson-open\">\n<a class=\"reference internal image-reference\" href=\"../../_images/ghap-nb-geojson-open.png\"><img alt=\"../../_images/ghap-nb-geojson-open.png\" src=\"../../_images/ghap-nb-geojson-open.png\" style=\"width: 400px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 30.11 </span><span class=\"caption-text\">Double click on the GeoJSON file to open it in JupyterLab</span><a class=\"headerlink\" href=\"#ghap-nb-geojson-open\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#ghap-layers\"]": "<figure class=\"align-default\" id=\"ghap-layers\">\n<a class=\"reference internal image-reference\" href=\"../../_images/ghap-layers.png\"><img alt=\"../../_images/ghap-layers.png\" src=\"../../_images/ghap-layers.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 30.15 </span><span class=\"caption-text\">Click on the <strong>Create Layer</strong> button</span><a class=\"headerlink\" href=\"#ghap-layers\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#ghap-nb-geojson\"]": "<figure class=\"align-default\" id=\"ghap-nb-geojson\">\n<a class=\"reference internal image-reference\" href=\"../../_images/ghap-nb-geojson.png\"><img alt=\"../../_images/ghap-nb-geojson.png\" src=\"../../_images/ghap-nb-geojson.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 30.12 </span><span class=\"caption-text\">Jupyter Lab displays your GeoJSON data on a map</span><a class=\"headerlink\" href=\"#ghap-nb-geojson\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#ghap-nb-download\"]": "<figure class=\"align-default\" id=\"ghap-nb-download\">\n<a class=\"reference internal image-reference\" href=\"../../_images/ghap-nb-download.png\"><img alt=\"../../_images/ghap-nb-download.png\" src=\"../../_images/ghap-nb-download.png\" style=\"width: 400px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 30.13 </span><span class=\"caption-text\">Download the CSV file</span><a class=\"headerlink\" href=\"#ghap-nb-download\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#using-mybinder\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Using MyBinder<a class=\"headerlink\" href=\"#using-mybinder\" title=\"Link to this heading\">#</a></h4><p>To use the MyBinder service, click on the MyBinder tab under the notebook preview. You should see a big, blue <strong>Run live on MyBinder</strong> button. Click on the button to launch the Binder service. No login is required, so MyBinder immediately starts building a customised computing environment. This can take a while, but eventually the notebook should load in the Jupyter Lab interface.</p>", "a[href=\"../../understanding-search/finding-digitised-content.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">11. </span>Finding NLA digitised content you can download<a class=\"headerlink\" href=\"#finding-nla-digitised-content-you-can-download\" title=\"Link to this heading\">#</a></h1><p>Trove provides a platform for the delivery of digitised content from the National Library of Australia and its partners. This digitised content is easy to find in the <em>Newspapers &amp; gazettes</em> and <em>Magazines &amp; newsletters</em> categories \u2013 they\u2019re full of it! But it\u2019s not so easy to find digitised content in other categories where it\u2019s mixed with works aggregated from a range of different sources.</p><p>There are a few different approaches to finding digitised content, but they all have potential problems. While I highlight what I think is the most reliable option, it\u2019s really a matter of working out what will best meet your research needs.</p>", "a[href=\"#ghap-nb-map\"]": "<figure class=\"align-default\" id=\"ghap-nb-map\">\n<a class=\"reference internal image-reference\" href=\"../../_images/ghap-nb-map.png\"><img alt=\"../../_images/ghap-nb-map.png\" src=\"../../_images/ghap-nb-map.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 30.9 </span><span class=\"caption-text\">Use the rectangle drawing tool to select an area</span><a class=\"headerlink\" href=\"#ghap-nb-map\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#ghap-nb-results\"]": "<figure class=\"align-default\" id=\"ghap-nb-results\">\n<a class=\"reference internal image-reference\" href=\"../../_images/ghap-nb-results.png\"><img alt=\"../../_images/ghap-nb-results.png\" src=\"../../_images/ghap-nb-results.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 30.10 </span><span class=\"caption-text\">Browse your results and download the dataset as a CSV or GeoJSON file</span><a class=\"headerlink\" href=\"#ghap-nb-results\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#ghap-nb-gw\"]": "<figure class=\"align-default\" id=\"ghap-nb-gw\">\n<a class=\"reference internal image-reference\" href=\"../../_images/ghap-nb-gw.png\"><img alt=\"../../_images/ghap-nb-gw.png\" src=\"../../_images/ghap-nb-gw.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 30.3 </span><span class=\"caption-text\">The GLAM Workbench provides a number of ways you can run the notebook</span><a class=\"headerlink\" href=\"#ghap-nb-gw\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#tools-and-data\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Tools and data<a class=\"headerlink\" href=\"#tools-and-data\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#finding-digitised-maps-in-trove\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Finding digitised maps in Trove<a class=\"headerlink\" href=\"#finding-digitised-maps-in-trove\" title=\"Link to this heading\">#</a></h2><p>To find digitised maps in Trove you can use a variation of <a class=\"reference internal\" href=\"../../understanding-search/finding-digitised-content.html\"><span class=\"std std-doc\">my standard hack</span></a>, searching for <code class=\"docutils literal notranslate\"><span class=\"pre\">\"nla.obj\"</span></code> in the \u2018Image\u2019 category, and then setting \u2018Type\u2019 to <code class=\"docutils literal notranslate\"><span class=\"pre\">Maps</span></code>, \u2018Format\u2019 to <code class=\"docutils literal notranslate\"><span class=\"pre\">Map</span></code>, and \u2018Access\u2019 to <code class=\"docutils literal notranslate\"><span class=\"pre\">Online</span></code>. This search currently <a class=\"reference external\" href=\"https://trove.nla.gov.au/search/category/images?keyword=%22nla.obj%22&amp;amp;l-artType=Maps&amp;amp;l-format=Map&amp;amp;l-availability=y\">returns more that 40,000 results</a>.</p><p><a class=\"reference external\" href=\"https://troveconsole.herokuapp.com/v3/?url=https%3A%2F%2Fapi.trove.nla.gov.au%2Fv3%2Fresult%3Fq%3D%22nla.obj%22%26category%3DImage%26l-artType%3DMaps%26l-format%3DMap%26l-availability%3Dy%26encoding%3Djson&amp;amp;comment=\"><img alt=\"Try it!\" src=\"https://troveconsole.herokuapp.com/static/img/try-trove-api-console.svg\"/></a></p>", "a[href=\"#gw-iiif-nb\"]": "<figure class=\"align-default\" id=\"gw-iiif-nb\">\n<a class=\"reference internal image-reference\" href=\"../../_images/ardc-binder-aaf-login.png\"><img alt=\"../../_images/ardc-binder-aaf-login.png\" src=\"../../_images/ardc-binder-aaf-login.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 30.4 </span><span class=\"caption-text\">ARDC Binder will ask you to log in using AAF</span><a class=\"headerlink\" href=\"#gw-iiif-nb\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#ghap-layer-map\"]": "<figure class=\"align-default\" id=\"ghap-layer-map\">\n<img alt=\"../../_images/ghap-layer-map.png\" src=\"../../_images/ghap-layer-map.png\"/>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 30.1 </span><span class=\"caption-text\"><a class=\"reference external\" href=\"https://ghap.tlcmap.org/layers/1341\">Collection of maps relating to Fiji</a> visualised in GHAP</span><a class=\"headerlink\" href=\"#ghap-layer-map\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#ghap-add-layer\"]": "<figure class=\"align-default\" id=\"ghap-add-layer\">\n<a class=\"reference internal image-reference\" href=\"../../_images/ghap-add-layer.png\"><img alt=\"../../_images/ghap-add-layer.png\" src=\"../../_images/ghap-add-layer.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 30.16 </span><span class=\"caption-text\">Describe your layer</span><a class=\"headerlink\" href=\"#ghap-add-layer\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#cluster-map\"]": "<figure class=\"align-default\" id=\"cluster-map\">\n<a class=\"reference internal image-reference\" href=\"../../_images/cluster-map.png\"><img alt=\"../../_images/cluster-map.png\" src=\"../../_images/cluster-map.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 30.2 </span><span class=\"caption-text\"><a class=\"reference external\" href=\"https://glam-workbench.net/trove-maps/trove-map-clusters.html\">Explore locations</a> of Trove\u2019s digitise maps</span><a class=\"headerlink\" href=\"#cluster-map\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#ghap-nb-jupyterlab\"]": "<figure class=\"align-default\" id=\"ghap-nb-jupyterlab\">\n<a class=\"reference internal image-reference\" href=\"../../_images/ghap-nb-jupyterlab.png\"><img alt=\"../../_images/ghap-nb-jupyterlab.png\" src=\"../../_images/ghap-nb-jupyterlab.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 30.7 </span><span class=\"caption-text\">The notebook running in Jupyter Lab</span><a class=\"headerlink\" href=\"#ghap-nb-jupyterlab\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#creating-a-subset-of-digitised-maps-by-searching-for-coordinates\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Creating a subset of digitised maps by searching for coordinates<a class=\"headerlink\" href=\"#creating-a-subset-of-digitised-maps-by-searching-for-coordinates\" title=\"Link to this heading\">#</a></h2><p>As noted, 28,205 maps in the harvested dataset have usable spatial coordinates. The GLAM Workbench notebook <a class=\"reference external\" href=\"https://glam-workbench.net/trove-maps/create-map-subsets/\">Create a subset of digitised maps by searching for coordinates</a> uses this data to create a GeoDataFrame that you can query using another set of coordinates. For example, if you query the GeoDataFrame with a bounding box it will return details of all the maps whose centre points fall within the coordinates of that bounding box. In other words, you can find maps by their location.</p><p>To make it easier to query by bounding box, the notebook generates a world map showing map locations. You simply use the map\u2019s rectangle drawing tool to select a particular region. The notebook returns details of all maps in that region, providing downloadable datasets in CSV and GeoJSON formats.</p>", "a[href=\"#aaf-institutions-select\"]": "<figure class=\"align-default\" id=\"aaf-institutions-select\">\n<a class=\"reference internal image-reference\" href=\"../../_images/aaf-institutions-select.png\"><img alt=\"../../_images/aaf-institutions-select.png\" src=\"../../_images/aaf-institutions-select.png\" style=\"width: 300px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 30.5 </span><span class=\"caption-text\">Select your institution from the AAF list</span><a class=\"headerlink\" href=\"#aaf-institutions-select\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#ghap-layer-info\"]": "<figure class=\"align-default\" id=\"ghap-layer-info\">\n<a class=\"reference internal image-reference\" href=\"../../_images/ghap-layer-info.png\"><img alt=\"../../_images/ghap-layer-info.png\" src=\"../../_images/ghap-layer-info.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 30.17 </span><span class=\"caption-text\">Click on the <strong>Import from file</strong> button</span><a class=\"headerlink\" href=\"#ghap-layer-info\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
